export const COLUMNS=[
    {
        Header: 'ID',
        accessor: 'id'
      },
      {
        Header: 'Title',
        Footer:'',
        accessor: 'title'
      },
      {
        Header: 'Description',
        Footer:'',
        accessor: 'description'
      },
      {
        Header: 'Price',
        Footer:'',
        accessor: 'price'
      },
      {
        Header: 'Category',
        Footer:'',
        accessor: 'category'
      },
      {
        Header: 'Sold',
        Footer:'',
        accessor: 'sold',
        Cell: ({ value }) => (value ? 'Yes' : 'No'),
      },
      
      {
        Header: 'Image',
        Footer:'',
        accessor: 'image'
      },
]
